import { StyleSheet, Text, View, Pressable } from "react-native";
import { Card } from "../Card";
import React from "react";

export const Category = ({ cat }) => {
  return (
    <Pressable>
      <Card>
        <Text style={styles.categoryText}>{cat}</Text>
      </Card>
    </Pressable>
  );
};

const styles = StyleSheet.create({
  categoryText: {
    fontSize: 15,
    color: "black",
  },
});
